    t[238] = "Allocate number of processor threads for building tunnels. If your processor supports hyperthreading or simultaneous multithreading, you may multiply the number of processor cores by 2 to get the maximum number of threads to allocate, otherwise number of processor cores = maximum number of threads available. Note that you may wish to allocate less than the theoretical maximum to ensure you have headroom for other tasks.";
    t[239] = "Wijs het aantal processorthreads toe voor het opbouwen van tunnels. Als uw processor hyperthreading of simultaan multithreading ondersteunt, kunt u het aantal processorkernen vermenigvuldigen met 2 om het maximale aantal threads toe te wijzen. Anders is het aantal processorkernen gelijk aan het maximale aantal beschikbare threads. Houd er rekening mee dat u mogelijk minder wilt toewijzen dan het theoretische maximum om ruimte over te houden voor andere taken.";
