    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "Eepget is een command-line applicatie meegeleverd met I2P die wordt gebruikt om URL-bronnen op te vragen, vergelijkbaar met <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> of <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget wordt ook intern door de router gebruikt, bijvoorbeeld om opnieuw te zaaien vanaf externe hosts. Standaard maakt eepget gebruik van de HTTP-proxy op <code>127.0.0.1:4444</code>.";
