    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "Een eepsite is een website die anoniem gehost wordt op het I2P-netwerk - u kunt er toegang toe krijgen door uw webbrowser te configureren om I2P's HTTP-proxy te gebruiken (zie hierboven) en te surfen naar de website met de toevoeging <code>.i2p</code> (bijv. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Zorg er ook voor dat uw browser zo geconfigureerd is dat DNS extern wordt opgelost wanneer u de proxy gebruikt om DNS-lekken te voorkomen.";
