    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "Het eerste getal is het aantal peers waarmee uw router in de afgelopen paar minuten een bericht heeft verzonden of ontvangen. Dit kan vari\u00ebren van 8-10 tot enkele honderden, afhankelijk van uw totale bandbreedte, gedeelde bandbreedte en lokaal gegenereerd verkeer. Het tweede getal is het aantal peers dat in het afgelopen uur is gezien. Maak u geen zorgen als deze cijfers sterk vari\u00ebren. <a href='/configstats#router.activePeers'>[Schakel grafieken in]</a>.";
