    t[980] = "Your webserver is running by default at <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, but is not accessible by others until you start the <i>I2P Webserver</i> tunnel. After starting the tunnel, your site will be difficult for other people to find. You could just tell people the destination or the Base32 address, but thankfully I2P has an address book to store domain names, and various services where you can <a href=/help/hostnameregistration>register a new .i2p domain</a> for free.";
    t[981] = "Uw webserver draait standaard op <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, maar is niet toegankelijk voor anderen totdat u de <i>I2P Webserver</i> tunnel start. Na het starten van de tunnel zal uw site moeilijk vindbaar zijn voor andere mensen. U kunt mensen gewoon de bestemming of het Base32-adres vertellen, maar gelukkig heeft I2P een adresboek om domeinnamen op te slaan en verschillende diensten waar u kosteloos een nieuwe .i2p domeinnaam kunt <a href=/help/hostnameregistration>registreren</a>.";
