    t[1174] = "Unless an outproxy has been set up for the service you want to connect to, this is not possible, with the exception of BitTorrent (see below). There are only three types of outproxies running right now: HTTP, HTTPS, and email. Note that there is currently no publicly listed SOCKS outproxy. If this type of service is required, try <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
    t[1175] = "Tenzij er een uitproxy is ingesteld voor de dienst waarmee u verbinding wilt maken, is dit niet mogelijk, met uitzondering van BitTorrent (zie hieronder). Er zijn momenteel slechts drie soorten uitproxies actief: HTTP, HTTPS en e-mail. Let op: er is momenteel geen openbaar vermelde SOCKS uitproxy. Als dit soort dienst vereist is, probeer dan <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
