    t[1209] = "Kijken naar Big Tech...";
    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "De afwijking (offset) van de klok van uw computer ten opzichte van de netwerkgesynchroniseerde tijd (indien bekend). I2P vereist dat de tijd van uw computer nauwkeurig is. Als de afwijking meer dan een paar seconden is, corrigeer dan het probleem door de tijd van uw computer aan te passen. Als I2P geen verbinding kan maken met internet, kan een meting van 0 ms worden weergegeven. Opmerking: dit wordt alleen weergegeven in de sectie <i>Routerinformatie (geavanceerd)</i>. U kunt deze sectie toevoegen aan uw zijbalk op de <a href='/configsidebar'>Configuratiepagina zijbalk</a>.";
