    t[2211] = "I2P selecteert een willekeurige poort tussen 9000 en 31000 om te communiceren met andere routers wanneer het programma voor de eerste keer wordt uitgevoerd, of wanneer uw externe IP-adres verandert bij gebruik van <a href=/confignet#ipchange>Laptop Mode</a>. De <a href=/confignet#udpconfig>geselecteerde poort</a> wordt weergegeven op de <a href=/confignet>Netwerkconfiguratie pagina</a>.";
