    t[2232] = "It will take at least 10 minutes from your router starting for it to accept building participating tunnels in order to ensure your router is stable and successfully bootstrapped to the network.";
    t[2233] = "Het duurt ten minste 10 minuten nadat uw router is gestart voordat deze deelneemt aan de opbouw van tunnels om ervoor te zorgen dat uw router stabiel is en succesvol is opgestart naar het netwerk.";
