    t[2247] = "Een vriendelijke introductie tot I2P";
    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "Hoelang banen wachten voordat ze worden uitgevoerd. De banenlijst wordt weergegeven op de <a href='/jobs'>Banenpagina</a>. Helaas zijn er verschillende andere banenwachtrijen in de router die mogelijk verstopt zijn, en hun status is niet beschikbaar in de routerconsole. De achterstand in de banen zou in het algemeen nul moeten zijn. Als het consistent hoger is dan 500 ms, is uw computer erg traag, heeft uw netwerk connectiviteitsproblemen of heeft de router ernstige problemen. <a href='/configstats#jobQueue.jobLag'>[Grafieken inschakelen]</a>.";
    t[2252] = "Configure I2P Updates";
    t[2253] = "Configureer I2P Updates";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Voordat u de wereld over uw nieuwe website vertelt, moet u wat inhoud toevoegen. Ga naar de hoofdmap van de server <a href=#rootdir>hierboven vermeld</a> en vervang de <i>index.html</i>-omleidingspagina door uw eigen inhoud. Als u een sjabloon nodig heeft voor een basissite, kunt u <a href=http://127.0.0.1:7658/help/pagetemplate.html>deze pagina</a> aanpassen. Als u na het bewerken van de inhoud naar deze pagina terugkeert, kunt u proberen de webcache van uw browser te wissen.";
