    t[2312] = "If your router has 10 or more active peers, everything is fine. The router should maintain connections to a few peers at all times. The best way to stay \"better-connected\" to the network is to <a href=/config>share more bandwidth</a>.";
    t[2313] = "Als je router 10 of meer actieve peers heeft, is alles in orde. De router moet te allen tijde verbindingen met enkele peers behouden. De beste manier om \"beter verbonden\" te blijven met het netwerk is om <a href=/config>meer bandbreedte te delen</a>.";
