    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "Om je eigen hostnaam te verkrijgen, bieden I2P-domeinregistrars zoals <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> of <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> registratiediensten aan waarmee je een .i2p hostnaam of subdomein kunt registreren en beheren die vervolgens door het netwerk wordt verspreid. Sommige registratiesites zullen het <i>B64-bestemmingsadres</i> vereisen voor de tunnel/service waarmee je een hostnaam wilt associ\u00ebren, die je moet kopi\u00ebren uit de sectie <i>Lokale bestemming</i> op de <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnelbeheerconfiguratiespagina</a>.";
