    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "Dit geeft aan hoeveel RAM I2P gebruikt en de totale hoeveelheid beschikbaar gesteld door Java. Als het gebruik consistent hoog is in verhouding tot het beschikbare RAM-geheugen, kan dit erop wijzen dat u meer RAM moet toewijzen aan de JVM. U kunt meer RAM toewijzen door uw <code>wrapper.config</code> bestand te bewerken dat zich meestal bevindt in de I2P-toepassingsmap. U moet de parameter <code>wrapper.java.maxmemory</code> bewerken, die standaard is ingesteld op 256(MB) voor I2P, of 384 voor I2P+. Opmerking: als de geheugenbalk is ingeschakeld, wordt de geheugeninvoer in de routerinformatiesectie onderdrukt.";
