    t[2538] = "To serve your own static content, you only need to edit or replace the files in the webserver's root directory, and the site will be available on the I2P network after you've followed the instructions below. Additionally, cgi and python scripts can be run from the <code>cgi-bin</code> directory immediately above <code>docroot</code> if you have <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> and <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> installed.";
    t[2539] = "Om uw eigen statische inhoud te serveren, hoeft u alleen maar de bestanden in de rootdirectory van de webserver te bewerken of te vervangen, en de site zal beschikbaar zijn op het I2P-netwerk nadat u de onderstaande instructies hebt gevolgd. Daarnaast kunnen cgi- en python-scripts worden uitgevoerd vanuit de directory <code>cgi-bin</code>, direct boven <code>docroot</code>, als u <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> en <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> ge\u00efnstalleerd heeft.";
