    t[2598] = "If you wish to install unsigned (.zip) I2P updates, this should be added to your <code>router.config</code> file unless you have already configured <code>routerconsole.advanced=true</code>, in which case this option is already provisioned. Note: as of I2P+ 0.9.48+, installation of <a href=/configupdate#i2pupdates>unsigned updates</a> is enabled by default.";
    t[2599] = "Als je ondertekende (.zip) I2P-updates wilt installeren, moet dit worden toegevoegd aan je <code>router.config</code> bestand, tenzij je al <code>routerconsole.advanced=true</code> hebt geconfigureerd, in welk geval deze optie al is voorzien. Opmerking: vanaf I2P+ 0.9.48+ is installatie van <a href=/configupdate#i2pupdates>ongesigneerde updates</a> standaard ingeschakeld.";
