    t[2617] = "Als je iemand kent en vertrouwt die I2P gebruikt, vraag hen dan om je een reseed-bestand te sturen dat is gegenereerd met behulp van deze pagina in hun routerconsole. Selecteer vervolgens de optie <i>Reseed vanuit bestand</i> op de {0} en gebruik het ontvangen bestand.";
