    t[2683] = "WAN Ethernet Link Configuratie";
    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "Deze instelling (in seconden) stelt u in staat om de vertraging tussen de uitvoeringen van de Peer Exploration Job, die nieuwe peers probeert te vinden om toe te voegen aan de NetDb, te overschrijven. De job wordt standaard elke 80 seconden uitgevoerd, of elke 3 minuten als de router te maken heeft met job- of berichtenvertraging. Als de grootte van de NetDb 4000 peers bereikt, wordt de pauze verhoogd naar 15 minuten. U kunt de vertraging verhogen als uw NetDb goed bevolkt is (meer dan 2000 peers) of als u de totale bandbreedte wilt verminderen. Opmerking: voor Floodfill-routers wordt deze job niet uitgevoerd.";
    t[2698] = "Current";
    t[2699] = "Huidig";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "Een website gehost op het I2P-netwerk. Standaard is een <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty-webserver</a> geconfigureerd en actief op <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "Kan worden uitgeschakeld of gewijzigd in de <a href=/i2ptunnelmgr>Tunnelbeheerder</a>. Kan ook geconfigureerd worden om te binden aan een specifieke interface of alle interfaces.";
    t[2728] = "I2P+ Service now enabled on system start";
