    t[2758] = "Advanced Lookup";
    t[2759] = "Geavanceerd zoeken";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "Om websites te kunnen bezoeken die gehost worden op I2P en optioneel gebruik te kunnen maken van de standaard outproxy om verbinding te maken met websites op het clearnet, moet je je browser configureren om de I2P HTTP-proxy te gebruiken, die standaard draait op <code>127.0.0.1 poort 4444</code>. De meeste browsers bieden de mogelijkheid om je proxy te configureren; in deze mini-handleiding richten we ons op Firefox.";
    t[2776] = "Close to us";
    t[2777] = "Dicht bij ons";
    t[2790] = "I2P+ Router Sitemap";
    t[2791] = "I2P-routersitemap";
    t[2794] = "Downloaded plugin version {0} is not newer than installed plugin";
    t[2795] = "De gedownloade plugin versie {0} is niet nieuwer dan de ge\u00efnstalleerde plugin";
    t[2796] = "Streaming radio service";
    t[2797] = "Radiostreamingservice";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+ functioneert het beste als u de snelheid van uw netwerkverbinding nauwkeurig kunt weergeven in het <a href=/config>gedeelte voor bandbreedteconfiguratie</a>. Standaard is I2P+ geconfigureerd met een aantal redelijk conservatieve waarden die in veel gebruikssituaties niet geschikt zijn. Neem dus de tijd om deze instellingen te bekijken en waar nodig te corrigeren. Hoe meer bandbreedte u toewijst, <i>specifiek</i> upstream-bandbreedte, hoe meer u profiteert van het netwerk.";
    t[2810] = "Transit by Peer";
