    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "Het I2P Netwerk Protocol (I2NP) beheert de routing en het mixen van berichten tussen routers, naast de transportselectie (waar meer dan \u00e9\u00e9n wordt ondersteund) bij het communiceren met een peer. Zie voor meer informatie de <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentatie</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "Verliep {0} geleden";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "De status van uw router met betrekking tot het accepteren of weigeren van verzoeken van andere routers om een deelnemende tunnel op te bouwen via uw router. Uw router kan alle verzoeken accepteren, een percentage van de verzoeken accepteren of weigeren, of alle verzoeken om verschillende redenen weigeren, om de bandbreedte- en CPU-eisen te beheersen en de capaciteit voor lokale clients te behouden. <b>Noot";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "Neem contact op met een bekende betrouwbare vriend die een werkende I2P-router heeft en vraag hem om hulp bij het herstarten van uw I2P-router. Vraag hem om u een reseed-bestand te sturen dat ge\u00ebxporteerd is vanuit zijn werkende I2P-router. Het is essentieel dat het bestand wordt uitgewisseld via een beveiligd kanaal, bijvoorbeeld versleuteld om externe manipulatie te voorkomen (PGP Sign Encrypt en geverifieerd met een vertrouwde openbare sleutel). Het bestand zelf is ondertekend, accepteer dus alleen bestanden van bekende vertrouwde vrienden. Importeer nooit een reseed-bestand als u de bron niet kunt verifi\u00ebren.";
    t[2916] = "Last Good Send";
