    t[2921] = "Je kunt een recorder gebruiken in \u00e9\u00e9n tunnel die schrijft naar een bestand dat een andere tunnel, of meerdere tunnels, kan gebruiken voor vertraging. Deze bestanden kunnen ook handmatig worden bewerkt.";
