    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "De onderstaande Java-webapplicaties worden gestart door de webConsole-client en draaien in dezelfde JVM als de router. Ze zijn meestal webapplicaties die toegankelijk zijn via de routerconsole. Ze kunnen complete applicaties zijn (bijvoorbeeld i2psnark), front-ends voor een andere client of applicatie die apart moet worden ingeschakeld (bijvoorbeeld susidns, i2ptunnel), of helemaal geen webinterface hebben (bijvoorbeeld addressbook).";
