    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "Dit is het totale aantal peers dat jouw router kent. Ze worden vermeld op de <a href='/netdb'>Netwerk Database pagina</a>. Dit kan vari\u00ebren van minder dan 100 tot 1000 of meer. Dit aantal is niet de totale grootte van het netwerk; het kan sterk vari\u00ebren afhankelijk van je totale bandbreedte, gedeelde bandbreedte en lokaal gegenereerd verkeer. I2P vereist niet dat een router elke andere router in het netwerk kent.";
