    t[3062] = "You can override the <a href=http://127.0.0.1:7658/help/images/>default appearance</a> of the directory listing by supplying an edited <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> file to set a global appearance. Note that this file will not be displayed in the webserver's directory listing. Files and directories prefixed with . and files named favicon.ico or files ending with ~ or .bak or .old will also be hidden from view (though still accessible). Note: To create hidden files with a . prefix on Windows, add a trailing . to the file or directory e.g. <code>.hidden.</code>; Windows explorer will then save the file with the correct name, removing the trailing dot in the process.";
    t[3063] = "U kunt het <a href=http://127.0.0.1:7658/help/images/>standaarduiterlijk</a> van de directorylijst overschrijven door een bewerkt <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> bestand te leveren om een globaal uiterlijk in te stellen. Houd er rekening mee dat dit bestand niet wordt weergegeven in de directorylijst van de webserver. Bestanden en mappen met een . voorvoegsel en bestanden met de naam favicon.ico of bestanden die eindigen op ~ of .bak of .old worden ook verborgen (hoewel nog steeds toegankelijk). Opmerking: om verborgen bestanden met een . voorvoegsel op Windows te maken, voegt u een punt aan het bestand of de map toe, bijvoorbeeld <code>.verborgen.</code>; Windows Verkenner slaat het bestand vervolgens op met de juiste naam, waarbij de punt aan het einde wordt verwijderd.";
