    t[3188] = "When set to true, additional functionality will be enabled in the console and the user will be able to edit settings directly on the <a href=/configadvanced>Advanced Configuration page</a>. Extra display options are provided in the <a href=/netdb>Network Database section</a>, including the <a href='/netdb?f=3'>Sybil Analysis tool</a>, and there are additional configuration options on the <a href=/configclients>Clients Configuration page</a>. This will also enable the installation of unsigned updates, manual configuration of the news URL, and additional sections on the sidebar.";
    t[3189] = "Wanneer ingesteld op waar, zullen er extra functionaliteiten worden ingeschakeld in de console en zal de gebruiker instellingen direct kunnen bewerken op de <a href=/configadvanced>Geavanceerde configuratiepagina</a>. Extra weergaveopties worden geboden in de <a href=/netdb>Network Database-sectie</a>, inclusief de <a href='/netdb?f=3'>Sybil Analysis tool</a>, en er zijn aanvullende configuratieopties op de <a href=/configclients>Clients configuratiepagina</a>. Dit maakt ook de installatie van niet-ondertekende updates mogelijk, handmatige configuratie van de nieuws-URL en extra secties aan de zijkant.";
