    t[3303] = "Dit is een experimentele netwerkdatabasetool voor foutopsporing en analyse. Raak niet in paniek, zelfs als u waarschuwingen ziet aangegeven. Mogelijke \"bedreigingen\" zijn samengevat, maar dit is onwaarschijnlijk dat dit echte bedreigingen zijn. Als u iets ziet dat u met de ontwikkelaars wilt bespreken, neemt u contact met ons op op IRC #i2p-dev.";
