    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "Dit is het aantal peers dat uw router beschikbaar heeft om clienttunnels te maken. Het ligt meestal tussen 8-30. Uw snelle peers worden weergegeven op de <a href='/profiles'>Profielpagina</a>. <a href='/configstats#router.fastPeers'>[Schakel grafieken in]</a>";
