    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "Een variant van onion routing die meerdere berichten samen versleutelt om het voor aanvallers moeilijker te maken om verkeersanalyse uit te voeren en om de snelheid van gegevensoverdracht te verhogen. Voor meer informatie, zie de <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentatie</a>.";
    t[3494] = "How to Harden Your WordPress Site";
