    t[3496] = "I2P Internals";
    t[3497] = "I2P Intern";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Standaard wordt I2P geleverd met een webserver om uw eigen geanonimiseerde website te hosten (traditioneel aangeduid als een <i>eepsite</i>). Zowel de site als de I2P Router Console draaien op een gestroomlijnde versie van <a href='https://nl.wikipedia.org/wiki/Jetty_(webserver)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, aangepast voor I2P.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Met deze instelling kunt u oudere routers uitsluiten van uw NetDb. Routers die ouder zijn dan de standaardwaarde of de waarde die u instelt, worden verwijderd uit de NetDb en verbannen gedurende de routersessie. Standaard worden routers ouder dan 0.9.20 uitgesloten. Opmerking: vanaf I2P+ versie 0.9.46+ worden alleen routers met zeer recente versies gebruikt voor het bouwen van lokale tunnels. [Herstart vereist]";
