    t[3654] = "XChat-like client users can create a new network with the server <code>127.0.0.1/6668</code> (remember to tick <i>Bypass proxy server</i> if you have a proxy server configured), or you can connect with the command <code>/server 127.0.0.1 6668</code>. Different IRC clients may vary the syntax.";
    t[3655] = "Gebruikers van XChat-achtige clients kunnen een nieuw netwerk maken met de server <code>127.0.0.1/6668</code> (vergeet niet om <i>Proxyserver omzeilen</i> aan te vinken als je een proxyserver geconfigureerd hebt), of je kunt verbinding maken met het commando <code>/server 127.0.0.1 6668</code>. De syntax kan verschillen tussen verschillende IRC-clients.";
