    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "De routerconfiguratieopties hieronder zijn niet beschikbaar in de gebruikersinterface, meestal omdat ze zelden worden gebruikt of toegang bieden tot geavanceerde instellingen die de meeste gebruikers niet nodig hebben. Dit is geen uitputtende lijst. Sommige instellingen vereisen een herstart van de router om van kracht te worden. Let op, alle instellingen zijn hoofdlettergevoelig. U moet uw <code>router.config</code>-bestand bewerken om opties toe te voegen, of zodra u <code>routerconsole.advanced=true</code> hebt toegevoegd aan het router.config-bestand, kunt u instellingen bewerken in de console op de <a href=/configadvanced>Geavanceerde configuratiepagina</a>.";
