    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "Sommige IRC-clients zijn geconfigureerd om verbinding te verbreken met de server als er gedurende een bepaalde periode geen communicatie met de server is geweest. Dit kan soms problematisch zijn voor I2P IRC als de <i>ping time-out</i> waarde te laag is ingesteld. Het instellen van de ping time-out waarde in je client op een hoog getal (bijv. 320 seconden) resulteert vaak in een robuustere verbinding met het netwerk. In HexChat kun je de waarde configureren door <code>/set net_ping_timeout 320</code> in te typen. Dit schrijft de waarde naar je <code>hexchat.conf</code> bestand.";
    t[3964] = "Run at Startup?";
    t[3965] = "Start bij opstarten?";
    t[3972] = "Never";
    t[3973] = "Nooit";
    t[3978] = "An <a href=/confignet#ipchange>optional configuration</a> that automatically changes your <a href=/netdb?r=.>router identity</a> and <a href=/confignet#udpconfig>external port</a> when the public ip address your system is on changes. This can prevent an adversary from correlating your router identity and ip address in scenarios where your ip address may change frequently, for example when you're running I2P on a laptop from multiple locations.";
    t[3979] = "Een <a href=/confignet#ipchange>optionele configuratie</a> die automatisch uw <a href=/netdb?r=.>router identiteit</a> en <a href=/confignet#udpconfig>externe poort</a> verandert wanneer het openbare IP-adres van uw systeem verandert. Dit kan voorkomen dat een tegenstander uw router identiteit en IP-adres met elkaar correleert in scenario's waarin uw IP-adres vaak kan veranderen, bijvoorbeeld wanneer u I2P op een laptop vanaf meerdere locaties draait.";
    t[3982] = "The router is not configured to publish its address, therefore it does not expect incoming connections.";
    t[3983] = "De router is niet geconfigureerd om zijn adres te publiceren, daarom verwacht het geen inkomende verbindingen.";
    t[3998] = "A command-line application supplied with I2P+ (Linux/MacOS) that is used to perform a <code>head</code> request on a specified http resource on the network, returning various response headers from the remote server. By default, eephead uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[3999] = "Een opdrachtregeltoepassing die wordt geleverd met I2P+ (Linux/MacOS) en wordt gebruikt om een <code>head</code>-aanvraag uit te voeren op een opgegeven HTTP-bron op het netwerk, waarbij verschillende responsheaders van de externe server worden geretourneerd. Standaard maakt eephead gebruik van de HTTP-proxy op <code>127.0.0.1:4444</code>.";
