    t[4332] = "Note: The order of the declarations matters. The first threshold declaration for a given destination (whether explicit or listed in a referenced file) overrides any future thresholds for the same destination, whether explicit or listed in a file. Note: to apply a new filter file, the tunnel must be restarted after the location has been specified in the tunnel manager. Once configured, a definition file can be updated without requiring a restart of the target tunnel, although destinations that are blocked will persist until the tunnel is restarted.";
    t[4333] = "Opmerking: De volgorde van de verklaringen is belangrijk. De eerste drempelverklaring voor een bepaalde bestemming (zowel expliciet als vermeld in een bestand) vervangt eventuele toekomstige drempels voor dezelfde bestemming, zowel expliciet als vermeld in een bestand. Opmerking: om een \u200b\u200bnieuw filterbestand toe te passen, moet de tunnel worden herstart nadat de locatie is opgegeven in de tunnelbeheerder. Eenmaal geconfigureerd, kan een definitiebestand worden bijgewerkt zonder dat de doeltunnel opnieuw hoeft te worden gestart, hoewel geblokkeerde bestemmingen aanhouden totdat de tunnel opnieuw wordt gestart.";
