    t[4618] = "The higher the share bandwidth the more you improve your anonymity and help the network.";
    t[4619] = "Hoe meer bandbreedte je deelt, des te meer je anonimiteit verbeterd en je het netwerk helpt.";
    t[4624] = "<b>Note:</b> On some Apache installations, the <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> and <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> modules are enabled by default. It is important to disable these, or otherwise protect access to the urls, to avoid compromising the anonymity and security of your server.";
    t[4625] = "<b>Let op:</b> Op sommige Apache-installaties zijn de modules <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> en <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> standaard ingeschakeld. Het is belangrijk om deze uit te schakelen, of anders de toegang tot de URL's te beveiligen, om de anonimiteit en veiligheid van uw server niet in gevaar te brengen.";
