    t[4670] = "The version of the I2P software you are running. If a new version is available, you will be notified in the Sidebar. It is recommended to keep your router up to date to ensure optimal performance and security. Router updates are usually made available on average every 2-3 months.";
    t[4671] = "De versie van de I2P-software die u gebruikt. Als er een nieuwe versie beschikbaar is, wordt u op de hoogte gebracht in de zijbalk. Het wordt aanbevolen om uw router up-to-date te houden om optimale prestaties en beveiliging te garanderen. Routerupdates worden meestal gemiddeld elke 2-3 maanden beschikbaar gesteld.";
