    t[4702] = "NTCP (NIO-based TCP) and NTCP2 are TCP-based network transports which use Java's NIO (New I/O) TCP implementation to deliver I2NP messages between routers on the network. NTCP2 improves the resistance of NTCP to various attacks and automated traffic identification methods. For more information, see the <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[4703] = "NTCP (NIO-based TCP) en NTCP2 zijn op TCP gebaseerde netwerktransmissies die gebruikmaken van Java's NIO (New I/O) TCP-implementatie om I2NP-berichten te leveren tussen routers in het netwerk. NTCP2 verbetert de weerstand van NTCP tegen verschillende aanvallen en geautomatiseerde methoden voor het identificeren van verkeer. Voor meer informatie, zie de <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online documentatie</a>.";
    t[4708] = "You can use a recorder to log the destinations of aggressive clients to a specified file, and then use that same file to throttle them. The following snippet defines a filter that initially allows all connection requests, but if any single destination exceeds 180 requests in 60 seconds, it gets throttled down to 30 requests every 60 seconds:";
    t[4709] = "U kunt een recorder gebruiken om de bestemmingen van agressieve clients te loggen naar een specifiek bestand, en vervolgens datzelfde bestand gebruiken om ze te vertragen. De volgende sectie definieert een filter die in eerste instantie alle verbindingen toestaat, maar als een enkele bestemming meer dan 180 verzoeken in 60 seconden overschrijdt, worden deze vertraging naar 30 verzoeken per 60 seconden:";
