    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "I2P+ ondersteunt aangepaste thema-overschrijvingen voor de console, de tunnelmanager, I2PSnark, SusiDNS en Susimail, waardoor wijzigingen in de thema's behouden blijven na upgrades. Om een overschrijving te activeren, maak een CSS-bestand met de naam <code>override.css</code> met uw themawijzigingen en plaats het in de relevante themamap van het thema dat u wilt wijzigen, of hernoem \u00e9\u00e9n van de voorbeeldbestanden en vernieuw de browser dan. M. Let op dat de tunnelmanager en de console dezelfde override.css delen. Om een overschrijving te deactiveren, verwijder of hernoem het bestand <code>override.css</code> en vernieuw vervolgens de browser (meestal Control + Shift + R).";
