    t[5042] = "When set to true, this setting enables reverse DNS lookups for peers, triggered when displaying the country flag of a peer or when the hostname or domain is explicitly displayed in the console, or when the peer's RouterInfo is written to disk. In order to avoid repeat lookups, it's recommended to configure a generous caching policy for DNS lookups of 10 minutes or more, and to configure a privacy respecting DNS server in your operating system. [Disabled by default, restart required]";
    t[5043] = "Als deze instelling is ingesteld op waar, worden omgekeerde DNS-opzoekingen ingeschakeld voor peers, geactiveerd wanneer de landvlag van een peer wordt weergegeven, of wanneer de hostnaam of het domein expliciet wordt weergegeven in de console, of wanneer de RouterInfo van de peer naar schijf wordt geschreven. Om herhaalde opzoekingen te voorkomen, wordt aanbevolen om een genereus cachebeleid te configureren voor DNS-opzoekingen van 10 minuten of langer en om een DNS-server te configureren die de privacy respecteert in uw besturingssysteem. [Standaard uitgeschakeld, herstart vereist]";
