    t[5084] = "If you're running a dynamic site handling a large number of concurrent users, content caching can often improve the time taken to deliver pages. For content that rapidly changes, a <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>micro-caching strategy</a> may still yield some benefits. The <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx webserver</a> provides a competent caching sub-system, or for a more heavy-weight solution, have a look at <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
    t[5085] = "Als je een dynamische site draait die een groot aantal gelijktijdige gebruikers verwerkt, kan het cachen van inhoud vaak de tijd verbeteren die nodig is om pagina's te leveren. Voor inhoud die snel verandert, kan een <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>micro-cachingstrategie</a> toch enkele voordelen opleveren. De webserver <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx</a> biedt een competente caching-ondersteuning, of voor een zwaardere oplossing kun je kijken naar <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
