    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "Als na enkele minuten werktijd uw router 0 actieve peers en 0 bekende peers aangeeft, met een melding in de zijbalk dat u uw netwerkverbinding moet controleren, controleer dan of u toegang heeft tot internet. Als uw internetverbinding functioneel is, moet u mogelijk Java deblokkeren in uw firewall. Anders moet u mogelijk uw I2P-router opnieuw zaaien. Ga naar de <a href=/configreseed#reseedconfig>Reseed Configuration page</a> en klik op de knop <i>Save Changes and Reseed Now</i>. Voor meer informatie, zie de <a href=#reseedhelp>Reseed help section</a> hierboven.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "Een socket API van een hoger niveau voor clients. Alleen geopend wanneer een SAM V3-client een UDP-sessie aanvraagt. Kan worden ingeschakeld/uitgeschakeld op de pagina Clientconfiguratie. Kan worden gewijzigd in het bestand clients.config met de SAM opdrachtregeloptie sam.udp.port=nnnn.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "Als je wilt dat je site responsief aanvoelt, is beeldcompressie essentieel bij het hosten van grote afbeeldingen. Het gebruik van een service zoals <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> om je png- en jpeg-afbeeldingen te comprimeren, resulteert vaak in veel kleinere bestanden met minimaal verlies van kwaliteit. In sommige situaties kan het webp-formaat beter zijn dan jpegs, omdat het kleinere bestanden genereert met ongeveer dezelfde of betere visuele trouw. Bovendien is er brede browserondersteuning. Overweeg ook om svgs te gebruiken in plaats van bitmaps voor pictogrammen en illustraties - ze zijn vaak kleiner dan het equivalent bitmapbestand (voer ze door een service zoals <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> om onnodige ballast te verwijderen), schalen zonder kwaliteitsverlies en kunnen worden gecomprimeerd door je webserver.";
    t[5528] = "UPnP disabled on the device";
    t[5529] = "UPnP uitgeschakeld op het device";
    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "Standaard zullen de meeste van uw clientservices (mail, http-proxy, IRC) dezelfde set tunnels delen (omwille van de prestaties) en worden vermeld als <i>Gedeelde Clients</i> en <i>Gedeelde Clients(DSA)</i> in de zijbalk onder Service Tunnels en op de <a href=/tunnels>Tunnels-pagina</a>.";
