    t[5545] = "Dit gedeelte is standaard niet ingeschakeld, tenzij de <a href='/help/configuration#advancedconsole'>Geavanceerde Console-modus</a> is ingeschakeld. U kunt het inschakelen op de <a href='/configsidebar'>Configuratiescherm zijbalkpagina</a>.";
