    t[5713] = "Firewall met inkomend TCP ingeschakeld";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "Open de <a href=/confignet#udpconfig>poort van I2P</a> op uw modem, router en/of firewall(s) voor een betere connectiviteit (idealiter zowel UDP als TCP). Meer informatie over hoe u de poort kunt openen, vindt u op <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, naast onze forums en IRC-kanalen hieronder vermeld. Merk op dat I2P geen ondersteuning biedt voor het verbinden met internet via een http- of socks-proxy [patches welkom!], maar u kunt wel verbinden met proxy's via I2P zelf nadat u verbinding heeft gemaakt met het netwerk.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "Een tunnel filter kan bescherming bieden tegen DDoS-aanvallen, zonder de service voor legitieme gebruikers anderszins te onderbreken, zowel in combinatie met de tunnel throttler als alternatieve strategie. Het kan ook worden gebruikt om toegang tot een gehoste service te loggen om te bepalen of de server wordt aangevallen, of simpelweg om alle bezoekers op basis van I2P-bestemming te loggen. Daarnaast kan een filter tegelijkertijd functioneren als een whitelist en blacklist, waardoor het flexibeler is dan de toegangslijst-besturingselementen van de Tunnelbeheerder. Let op: meerdere servertunnels kunnen een enkel filterbestand delen als u een globaal filter wilt implementeren.";
