    t[6025] = "Landing page for various services";
    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "Deze instelling (in milliseconden) stelt u in staat om de vertraging tussen router refresh updates die worden uitgevoerd door de Refresh Routers Job handmatig te configureren. Standaard wordt de pauze tussen de vernieuwingen bepaald door de grootte van de NetDb en introduceert enige willekeurigheid in de timing om verkeersanalyse te verminderen. Voor waarden lager dan 2000 milliseconden wordt aanbevolen om de waarde van <code>router.refreshTimeout</code> te verhogen. Merk op dat het instellen van deze waarde onder 2000 milliseconden uw netwerkverkeer zal verhogen en mogelijk vertragingsproblemen in de taak kan introduceren, en wordt niet aanbevolen voor langdurig gebruik.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "Servertunnels, configureerbaar in de <a href=/i2ptunnelmgr>Tunnelbeheerder</a>, bieden verschillende manieren om de toegang tot de gehoste service te beperken. Bestemmings-Whitelisting, Blacklisting, Verbindingsdrosseling en Tunnel Filtering zijn methoden die zijn bedoeld om DDoS-aanvallen tegen te gaan, exclusieve toegang te verlenen tot bekende I2P-bestemmingen en het verkeer naar de server te beheren.";
