    t[6214] = "Do not reveal this file to unknown users, as it contains sensitive data (100 RouterInfo files) from your own I2P router which potentially could be used by an adversary to decloak your identity. In order to protect your anonymity: you should wait for a few hours/days before sharing the file with your trusted friend. It is also advisable to use this procedure sparingly (no more than once a week).";
    t[6215] = "Onthul dit bestand niet aan onbekende gebruikers, omdat het gevoelige gegevens bevat (100 RouterInfo-bestanden) van uw eigen I2P-router die mogelijk door een tegenstander kunnen worden gebruikt om uw identiteit te onthullen. Om uw anonimiteit te beschermen: moet u enkele uren/dagen wachten voordat u het bestand deelt met uw vertrouwde vriend. Het is ook raadzaam deze procedure spaarzaam te gebruiken (niet meer dan eens per week).";
