    t[6382] = "Note: To enhance your security when browsing .i2p sites, you may wish to consider installing an addon to prevent Javascript from running in the browser such as <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, though it's recommended to whitelist the address I2P+ is running on to enable various router console enhancements. In addition, an addon that prevents requests to offsite resources is also recommended, for example <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
    t[6383] = "Opmerking: Om uw beveiliging bij het browsen van .i2p-sites te verbeteren, kunt u overwegen een add-on te installeren om te voorkomen dat Javascript wordt uitgevoerd in de browser, zoals <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, hoewel het aanbevolen is om het adres waarop I2P+ draait toe te voegen aan de whitelist om verschillende router-console-verbeteringen mogelijk te maken. Daarnaast wordt ook aanbevolen om een add-on te installeren die verzoeken naar externe bronnen voorkomt, bijvoorbeeld <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
