    t[6762] = "I2P+ may be slow to integrate into network the first time you run it as it bootstraps into the network and learns of additional peers. The longer your I2P+ router is running, the better it will perform, so try and keep your router on as long as you can, 24/7 if possible! If, after 30 minutes, your <i>Active: [connected/recent]</i> count still has less than 10 peers, or your total number of <i>Integrated</i> peers is less than 5, there are several things you can do to check for problems:";
    t[6763] = "I2P+ kan de eerste keer dat je het uitvoert traag zijn om te integreren met het netwerk, omdat het opstart in het netwerk en leert van extra peers. Hoe langer je I2P+ router actief is, hoe beter het zal presteren, dus probeer je router zo lang mogelijk aan te laten staan, indien mogelijk 24/7! Als na 30 minuten het aantal <i>Actief: [geconnecteerd/laatst]</i> nog steeds minder dan 10 peers is, of het totale aantal <i>Ge\u00efntegreerd</i> peers minder dan 5 is, zijn er verschillende dingen die je kunt doen om problemen te controleren:";
