    t[6943] = "Grote capaciteit";
    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "Een Java-implementatie van een Tor-client, beschikbaar als een I2P-plug-in. Kan worden gebruikt als de standaard <i>uitlooppunt</i> als deze is geconfigureerd in de relevante SOCKS- of HTTP-clienttunnel in de <i>Tunnelbeheerder</i>. Beschikbaar op <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. De broncode is beschikbaar op <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "IPv4 adressen";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "Dit gedeelte geeft je gemiddelde snelheden van bandbreedte en totaal gebruik weer voor de sessie. Alle waarden zijn in bytes per seconde. Je kunt je bandbreedte-limieten wijzigen op de <a href='/config'>Bandbreedte Configuratie pagina</a>. Hoe meer bandbreedte je beschikbaar stelt, hoe meer je het netwerk helpt en je eigen anonimiteit verbetert, dus neem de tijd om de instellingen te bekijken. Als je niet zeker bent van de snelheid van je netwerk, kan het gebruik van een service zoals <a href='http://speedtest.net/'>SpeedTest</a> of iets vergelijkbaars je een goede indicatie geven van je bandbreedte capaciteit. Je upstream (KBps Uit) deel zal je algehele bijdrage aan het netwerk bepalen. Bandbreedte wordt standaard <a href='/graphs'>gegrafieerd</a>.";
