    t[7004] = "This setting allows you to configure the minimum number of hosted participating tunnels before the router starts to reject tunnel requests based on anticipated bandwidth requirements. [Default is 100 if system is running Android, 800 if system is running on ARM and less than 4 cores available, 1200 if system is running on ARM and 4 or more cores available, otherwise 2500]";
    t[7005] = "Deze instelling stelt u in staat het minimumaantal gehoste deelnemende tunnels te configureren voordat de router tunnelaanvragen begint af te wijzen op basis van verwachte bandbreedtevereisten. [Standaard is dit 100 indien het systeem Android draait, 800 indien het systeem draait op ARM en minder dan 4 cores beschikbaar zijn, 1200 indien het systeem draait op ARM en 4 of meer cores beschikbaar zijn, anders 2500]";
