    t[7030] = "In order to maintain anonymity, it is recommended to update using the I2P http proxy. If the news or I2P update is hosted on I2P, using the proxy will be necessary.";
    t[7031] = "Om de anonimiteit te behouden, wordt het aanbevolen om de I2P HTTP -proxy bij te werken. Als het nieuws of i2p -update wordt gehost op I2P, is het gebruik van de proxy nodig.";
