    t[7158] = "I2P does not work well behind this type of firewall. You will probably not be able to accept inbound connections, which will limit your participation in the network.";
    t[7159] = "I2P werkt niet goed achter dit type firewall. Je kunt waarschijnlijk geen inkomende verbindingen accepteren, wat je deelname aan het netwerk zal beperken.";
    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "Het I2P Client Protocol (I2CP) stelt externe applicaties (clients) in staat om te communiceren met I2P over een enkele TCP-socket, standaard via poort 7654. Voor meer informatie, zie de <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentatie</a>.";
    t[7168] = "Queue Totals";
