    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "Deze instelling bepaalt welk transport meer prioriteit heeft bij het communiceren met peers. Standaard heeft NTCP voorrang op UDP (SSU). Als de waarde op true wordt gezet, wordt UDP verkozen tenzij er al een bestaande NTCP-verbinding is. Als het op altijd wordt ingesteld, zal altijd UDP worden gebruikt, ongeacht eventuele bestaande NTCP-verbindingen. [Standaardwaarde is false]";
