    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (Secure Semi-reliable UDP) is een I2P-netwerktransport dat versleutelde, verbindingsgerichte, punt-naar-punt-verbindingen biedt, naast IP-adresdetectie en NAT-traversal-services. Voor meer informatie, zie de <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentatie</a>.";
    t[7314] = "Congestion window";
    t[7315] = "Congestievenster";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "Proxy gebruiken om opnieuw te zaaien";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "Tot de komst van I2P-integratie in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, was het niet mogelijk om torrents te downloaden die niet gehost waren op het I2P-netwerk. Echter, nu Vuze (en later <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) gebruikers in staat stellen om niet-I2P torrents te delen op I2P, kunnen niet-I2P torrents gedownload worden via I2P als Vuze/Bigly gebruikers ervoor gekozen hebben om content beschikbaar te stellen aan het I2P-netwerk. Populaire torrents met een groot aantal peers zijn waarschijnlijker toegankelijk via I2P; om te bepalen of de content beschikbaar is, voeg de torrentlink, magnet of infohash toe aan je I2P-enabled BitTorrent-client.";
