    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "Als een <i>Registratie Authenticatie</i> string wordt aangevraagd, kunt u deze vinden op de <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registratie Authenticatie pagina</a> die gelinkt is vanaf de <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuratie pagina</a>. Registratie authenticatie zorgt ervoor dat alleen de eigenaar de hostname kan registreren of beheren, en is vereist op stats.i2p en reg.i2p.";
