    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] Als u de router niet kunt starten met <code>i2p/i2prouter start</code>, probeer dan het script <code>runplain.sh</code> in dezelfde map. Root-rechten zijn nooit vereist om I2P+ uit te voeren. Als u de <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi-bibliotheek</a> moet compileren (wat in zeldzame gevallen nodig is), raadpleeg dan de documentatie, bezoek de fora of bezoek <a href=irc://127.0.0.1:6668/saltR class=chatlink>het I2P+ kanaal</a> of <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC-ontwikkelaarskanaal</a>.";
