    t[7690] = "A distributed database containing router contact information (RouterInfos) and destination contact information (LeaseSets). A single router maintains its own (partial) database for communicating with other routers on the network; no single router will maintain a list of all routers. The RouterInfos are stored on disk and read into memory when the router starts, or when new RouterInfos are acquired. Also referred to as the <i>NetDb</i>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7691] = "Een gedistribueerde database met router contactinformatie (RouterInfos) en bestemmingscontactinformatie (LeaseSets). Een enkele router onderhoudt zijn eigen (gedeeltelijke) database om te communiceren met andere routers op het netwerk; geen enkele router zal een lijst van alle routers bijhouden. De RouterInfos worden opgeslagen op de schijf en in het geheugen geladen wanneer de router start of wanneer nieuwe RouterInfos worden verkregen. Ook wel aangeduid als de <i>NetDb</i>. Voor meer informatie, zie de <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentatie</a>.";
    t[7692] = "Address";
    t[7693] = "Adres";
    t[7694] = "A threshold is defined by the number of connection attempts a remote destination is permitted to perform over a specified number of seconds before a \"breach\" occurs.";
    t[7695] = "Een drempel wordt gedefinieerd door het aantal verbindingspogingen dat een externe bestemming mag uitvoeren gedurende een bepaald aantal seconden voordat een \"overtreding\" optreedt.";
    t[7704] = "Clearnet normally refers to the publicly accessible internet, the opposite of the darknet that typically describes the encrypted, anonymous services built on I2P, Tor etc. For more information, see the <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia article</a>.";
    t[7705] = "Clearnet verwijst meestal naar het publiekelijk toegankelijke internet, het tegenovergestelde van het darknet dat typisch de versleutelde, anonieme services beschrijft die zijn gebouwd op I2P, Tor etc. Voor meer informatie zie het <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia-artikel</a>.";
