    t[7990] = "A router on the network tasked with providing and receiving information about other routers and services on the network. The current minimum share bandwidth for a router to be considered as capable of performing floodfill duties is 128 KBytes/sec, though it's possible to override this requirement and force a router to be a floodfill on the <a href=/configadvanced>Advanced Configuration page</a>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7991] = "Een router op het netwerk belast met het verstrekken en ontvangen van informatie over andere routers en diensten op het netwerk. De huidige minimale gedeelde bandbreedte voor een router om te worden beschouwd als in staat tot het uitvoeren van floodfill taken is 128 KBytes/sec, hoewel het mogelijk is om deze vereiste te negeren en een router te dwingen een floodfill te zijn op de <a href=/configadvanced>Geavanceerde configuratiepagina</a>. Voor meer informatie, zie de <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>online documentatie</a>.";
