    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "Waar mogelijk moeten assets die herhaaldelijk op je site worden gebruikt, worden geladen vanuit een extern bestand en niet inline. Als je dezelfde CSS op verschillende pagina's gebruikt, maak dan een apart CSS-bestand aan en laad dit in de <code>&lt;head&gt;</code>-sectie van je pagina's. Dit maakt het beheren van styling-updates op je site gemakkelijker en stelt het bestand in staat om te worden gecachet in de browser van de bezoeker, waardoor er minder bandbreedte wordt gevraagd van je webserver en pagina's sneller laden voor je bezoekers.";
