    t[8258] = "If you think you have opened up your firewall and I2P still thinks you are firewalled, remember that you may have multiple firewalls, for example both software packages and external hardware routers.";
    t[8259] = "Wanneer je denkt dat je je firewall open hebt gezet maar I2P nog steeds zegt dat je achter een firewall zit, bedenk dan dat je mogelijk meerdere firewalls hebt, bijvoorbeeld zowel als software pakket en een externe hardware router.";
    t[8270] = "The keyword <i class=example>deny</i>. This threshold is always breached, i.e. no connection attempts will be allowed.";
    t[8271] = "Het trefwoord <i class=example>weigeren</i>. Deze drempel wordt altijd overschreden, dat wil zeggen dat er geen verbindingspogingen worden toegestaan.";
    t[8282] = "log visitors making 90 or more connections a minute";
    t[8283] = "loggen van bezoekers die 90 of meer verbindingen per minuut maken";
    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "Je hebt inkomend TCP verkeer geconfigureerd, echter aangezien je UDP poort achter een firewall zit, is het waarschijnlijk dat dit ook voor je TCP poort het geval is.";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "Dit is het aantal peers dat je router zal gebruiken voor vragen aan het netwerkdatabase. Dit zijn meestal de <i>floodfill</i> routers die verantwoordelijk zijn voor het behoud van de netwerk integriteit. Je goed ge\u00efntegreerde peers worden weergegeven onderaan de <a href='/profiles'>Profielpagina</a>.";
    t[8298] = "Manage Router webapps";
