    t[8303] = "Uitgaand TCP-verkeer vanaf willekeurige poorten met hoge nummers naar willekeurige externe TCP-poorten.";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "Wanneer u I2P start, kan het een paar minuten duren voordat uw router in het netwerk is opgestart (ge\u00efntegreerd) en extra peers zijn gevonden, dus wees geduldig.";
    t[8318] = "No file specified. Please select a valid .zip or .su3 file to reseed from.";
    t[8319] = "Geen bestand opgegeven. Selecteer een geldig .zip- of .su3-bestand om uit te reseeden.";
