    t[8334] = "Function";
    t[8335] = "Functie";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "Op het I2P-netwerk kunnen op afstand gehoste services worden bereikt via een <a href=https://nl.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> adres eindigend op \".b32.i2p\", een <i>bestemming</i> voorgesteld als een lange <a href=https://nl.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> tekenreeks, of meestal door een .i2p-domein te gebruiken. Een bestemming is het equivalent van een IP-adres in I2P en wordt weergegeven op de pagina <a href='/i2ptunnel/edit?tunnel=3'>Tunnelbeheerconfiguratie</a>. U kunt uw b32.i2p adres delen om anderen toegang te geven tot uw website totdat u uw eigen .i2p-domein heeft geregistreerd.";
