    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "Om directorylijsten uit te schakelen, zoekt u de vermelding voor <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in het bestand <code>base-context.xml</code>, dat zich bevindt in de map <code>eepsite/contexts</code> (net boven de docroot-map), en wijzigt u 'true' in 'false' direct hieronder. Om de wijziging onmiddellijk toe te passen, stopt u de <i>I2P Webserver</i>-client op de <a href=/configclients>Pagina Clientconfiguratie</a> en start u deze opnieuw. U kunt ook een leeg bestand met de naam <code>index.html</code> in een willekeurige blootgestelde map plaatsen om directorylijsten op die locatie te onderdrukken.";
