    t[8572] = "<a href=/logs>Logs</a> may help resolve a problem. You may wish to paste excerpts in a <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for help, or perhaps <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>paste</a> it instead and reference the link on IRC for help.";
    t[8573] = "<a href=/logs>Logboeken</a> kunnen helpen bij het oplossen van een probleem. U kunt uittreksels in een <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> plakken voor hulp, of het misschien <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>plakken</a> en in plaats daarvan de link op IRC gebruiken voor hulp.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "Plugins ondertekend met de cryptografische sleutel van de ontwikkelaar worden aanbevolen, maar als u niet-ondertekende plugins (.zip) wilt installeren, kunt u dit op waar instellen. Let op, het kan nog steeds problemen opleveren bij het installeren van een niet-ondertekende plugin als de ontwikkelaar aanvullende controles heeft opgenomen in het plugin-buildproces.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "Als je lokaal een standalone Tor-instantie gebruikt, kun je deze gebruiken door I2P te configureren met: <i>Proxytype:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Poort:</i> <code>9050</code>.";
    t[8584] = "Select the language to be used for the router console and web applications (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnel manager</a> etc). If you wish to change the language in future, change the router console theme, or configure a password to access the console, you may do so on the <a href=/configui target=_blank rel=noreferrer>User Interface configuration page</a>.";
    t[8585] = "Selecteer de taal die moet worden gebruikt voor de routerconsole en webtoepassingen (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnelbeheerder</a>, enz.). Als u de taal in de toekomst wilt wijzigen, de consolethema wilt wijzigen of een wachtwoord wilt configureren om toegang te krijgen tot de console, kunt u dit doen op de pagina <a href=/configui target=_blank rel=noreferrer>Configuratie van de gebruikersinterface</a>.";
