    t[9052] = "Ready";
    t[9053] = "Gereed";
    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "Dit zijn de lokale services die worden aangeboden door uw router. Ze kunnen clients zijn die worden gestart via de<a href='/i2ptunnelmgr'>Tunnel Manager</a> of externe programma's die verbinding maken via SAM, BOB of rechtstreeks met I2CP. Standaard zullen de meeste van uw clientservices (mail, http proxy, IRC) dezelfde set tunnels delen en worden vermeld als <i>Gedeelde Clients</i> en <i>Gedeelde Clients(DSA)</i>, wat de anonimiteit verhoogt door het verkeer van alle gedeelde services te mengen en de overhead die nodig is om tunnels te bouwen en te onderhouden te verminderen. Echter, als u een tunnelstoring ondervindt, zullen al uw services tegelijkertijd offline gaan. Daarom kunt u in sommige scenario's ervoor kiezen om client services te configureren om hun eigen set tunnels te gebruiken. Dit kan worden gedaan door de optie <i>Deel tunnels met andere clients niet...</i> uit te vinken die wordt vermeld onder <i>Gedeelde Clients</i> op de configuratiepagina van de relevante clientservice in de Tunnel Manager. Daarna moet u de clientservice opnieuw starten vanaf de<a href='/i2ptunnelmgr'>hoofdpagina van de Tunnel Manager</a>.";
