    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "Een eenvoudige CGI-toepassing die een hostname als parameter accepteert en een 301-omleiding retourneert naar de juiste URL met een toegevoegde <code>?i2paddresshelper=key</code> string. De HTTP-proxy zal de toegevoegde string interpreteren en de sleutel als bestemming gebruiken. Bovendien zal de proxy de sleutel in de cache bewaren, zodat de adresassistent niet nodig is tot herstart, en de optie bieden om het opgeloste adres aan het adresboek toe te voegen.";
