    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "Reseeding is het opstartproces dat wordt gebruikt om andere routers te vinden wanneer u I2P voor het eerst installeert, of wanneer uw router te weinig routerverwijzingen over heeft. De standaardinstellingen werken voor de meeste mensen. Verander deze alleen als HTTPS wordt geblokkeerd door een beperkende firewall en reseed mislukt is.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "Deze instelling wijzigt de maximale extra willekeurige pong-vertraging die wordt ge\u00efntroduceerd voor ping-ingeschakelde servers, indien <code>i2p.streaming.enablePongDelay</code> ook is ingeschakeld. Tenzij expliciet ingesteld, wordt de standaardwaarde van 50 ms gebruikt.";
