    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
    t[9489] = "Houd er rekening mee dat de profiler afhankelijk is van langdurig clienttunnelgebruik om collega's nauwkeurig te profileren.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "Als u haast heeft en niet enkele uren kunt wachten, kunt u mensen vertellen om een \"jump\" adres helper doorverwijzingsservice te gebruiken. Dit zal meestal binnen enkele minuten werken nadat u uw hostname op dezelfde site hebt geregistreerd. Test het eerst zelf door <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>uwgekozenhostname.i2p</i></code> in uw browser in te voeren. Zodra het werkt, kunt u anderen vertellen om het te gebruiken.";
