    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "Tunnels die door andere routers worden gebouwd via jouw router. Dit kan sterk vari\u00ebren afhankelijk van de netwerkvraag, jouw gedeelde bandbreedte en de hoeveelheid lokaal gegenereerd verkeer. De aanbevolen methode om deelname aan tunnels te beperken, is door je aandeelpercentage te wijzigen op de <a href='/config'>Bandbreedteconfiguratiepagina</a>. Je kunt ook het totale aantal beperken door <code>router.maxParticipatingTunnels=nnn</code> in te stellen op de <a href='/configadvanced'>Geavanceerde configuratiepagina</a>. <a href='/configstats#tunnel.participatingTunnels'>[Grafiek inschakelen]</a>.";
