    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "Om een alternatieve webserver in te stellen voor gebruik in I2P, kun je ofwel de bestaande webservertunnel gebruiken en de standaard webserver <a href=/configclients>uitschakelen</a>, of een nieuwe HTTP Server tunnel aanmaken in de <a href=/i2ptunnelmgr>Tunnelbeheer</a>. Zorg ervoor dat de <i>luisterpoort</i> van de webserver ook geconfigureerd is in de instellingen van de Tunnelbeheer. Bijvoorbeeld, als je webserver standaard luistert op het adres 127.0.0.1 poort 80, moet je er ook voor zorgen dat de <i>Doelpoort</i> op de instellingenpagina van de Tunnelbeheer voor de service geconfigureerd is naar poort 80.";
