    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "Een I2P-router hoeft meestal slechts \u00e9\u00e9n keer gezaaid te worden om zich voor de eerste keer bij het netwerk aan te sluiten. Als de router echter gedurende lange tijd zonder netwerkverbinding draait, moet hij mogelijk ook opnieuw gezaaid worden. Het zaaien omvat het ophalen van meerdere 'RouterInfo'-bestanden (gecombineerd in een ondertekend zip-bestand) van ten minste twee vooraf gedefinieerde server-URL's die zijn gekozen uit een vrijwilligersgroep van clearnet HTTPS-servers.";
