    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "Een lijst van landen afgeleid van het <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> met een slechte reputatie op het gebied van burgerlijke vrijheden. Deze lijst wordt gebruikt om routers die draaien in de gespecificeerde landen in <i>Verborgen Modus</i> te plaatsen om gebruikers meer beveiliging te bieden. De volgende landen zijn aangeduid als strikte landen: Afghanistan, Azerbeidzjan, Bahrein, Wit-Rusland, Brunei, Burundi, Kameroen, Centraal-Afrikaanse Republiek, Tsjaad, China, Cuba, Democratische Republiek Congo, Egypte, Equatoriaal-Guinea, Eritrea, Ethiopi\u00eb, Iran, Kazachstan, Laos, Libi\u00eb, Myanmar, Noord-Korea, Palestijnse Gebieden, Rwanda, Saudi-Arabi\u00eb, Somali\u00eb, Zuid-Soedan, Sudan, Eswatini (Swaziland), Syri\u00eb, Tadzjikistan, Thailand, Turkije, Turkmenistan, Venezuela, Verenigde Arabische Emiraten, Oezbekistan, Westelijke Sahara, Jemen.";
