    t[10318] = "Where possible, please ensure I2P+/Java is allowed bi-directional port access from the internet by configuring your modem/router/pc firewall accordingly. If you're behind a prohibitive firewall but have unrestricted outbound access, I2P+ can still function; you can turn off inbound access and rely on <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) to connect you to the network, and your network status in the side panel will indicate \"Status: Firewalled\". For optimal performance, please ensure I2P's <a href=/confignet#udpconfig>external port</a> is visible from the internet (see below for more information).";
    t[10319] = "Indien mogelijk, zorg ervoor dat I2P+/Java tweerichtingspoorttoegang heeft vanaf het internet door uw modem/router/pc-firewall dienovereenkomstig te configureren. Als u achter een beperkende firewall zit maar onbeperkte uitgaande toegang heeft, kan I2P+ nog steeds functioneren; u kunt inkomende toegang uitschakelen en vertrouwen op <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP-adresdetectie</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall-hole punching</a>) om verbinding te maken met het netwerk, en de netwerkstatus in het zijpaneel geeft aan \"Status: Firewalled\". Voor optimale prestaties, zorg ervoor dat I2P's <a href=/confignet#udpconfig>externe poort</a> zichtbaar is vanaf het internet (zie hieronder voor meer informatie).";
