    t[10636] = "Jurist";
    t[10637] = "Jurist";
    t[10644] = "Skip Setup";
    t[10645] = "Setup overslaan";
    t[10650] = "Duplicate packets received from peer";
    t[10651] = "Dubbele pakketten ontvangen van peer";
    t[10660] = "Services may be hosted on multiple routers simultaneously, by sharing the same private key for the destination. Multihoming can further enhance the security and stability of a server by providing redundancy; if a server is multihomed, when a server in the pool goes offline, the provided service will remain available, making it more difficult to correlate server downtime with a router going offline.";
    t[10661] = "Diensten kunnen gelijktijdig worden gehost op meerdere routers door het delen van dezelfde priv\u00e9sleutel voor de bestemming. Multihoming kan de beveiliging en stabiliteit van een server verder verbeteren door redundantie te bieden. Als een server multihomed is en een server in de pool offline gaat, blijft de geleverde dienst beschikbaar, waardoor het moeilijker wordt om serverdowntime te correleren met een router die offline gaat.";
    t[10672] = "Client Configuration";
    t[10673] = "Client Configuratie";
    t[10674] = "Ensure your Java is up to date. Version 1.8 or higher is required; version 11 or higher is recommended. Check your Java version at the top of <a href=/info>the router information page</a>.";
    t[10675] = "Zorg ervoor dat uw Java up-to-date is. Versie 1.8 of hoger is vereist; versie 11 of hoger wordt aanbevolen. Controleer uw Java-versie bovenaan <a href=/info>de informatiepagina van de router</a>.";
    t[10678] = "I2CP Interface";
    t[10679] = "I2CP Interface";
    t[10684] = "Invalid port";
    t[10685] = "Ongeldige poort";
    t[10688] = "NetDb";
