    t[10706] = "They offered to introduce us";
    t[10707] = "Zij hebben aangeboden ons te introduceren";
    t[10708] = "Performing a soft restart";
    t[10709] = "Een zachte herstart uitvoeren";
    t[10710] = "The process of acquiring router identities, normally via <i>clearnet</i> servers, to ensure your router can communicate and build tunnels with other routers on the network. When a router has no router identities for other peers (usually immediately after installation), the process of reseeding is also referred to as <i>bootstrapping</i>.";
    t[10711] = "Het proces van het verkrijgen van router-identiteiten, meestal via <i>clearnet</i> servers, om ervoor te zorgen dat jouw router kan communiceren en tunnels kan bouwen met andere routers op het netwerk. Wanneer een router geen routeridentiteiten heeft voor andere peers (meestal direct na installatie), wordt het proces van hervullen ook wel <i>bootstrapping</i> genoemd.";
    t[10712] = "Direction/Introduction";
    t[10713] = "Richting/Introductie";
    t[10718] = "NTCP";
    t[10719] = "NTCP";
    t[10730] = "ANONYMITY WARNING - Settings include 0-hop tunnels.";
    t[10731] = "ANONIMITEITS WAARSCHUWING - Instellingen bevatten 0-hop tunnels.";
    t[10734] = "URL list reset successfully";
    t[10735] = "URL lijst succesvol gereset";
    t[10738] = "TheAtlantic";
    t[10739] = "De Atlantische";
    t[10740] = "Warning: could not set the I2P+ service to autostart";
    t[10741] = "Waarschuwing: kan de I2P-service niet instellen op automatisch starten";
    t[10746] = "A tunnel used by the router for communicating with other routers to perform various \"housekeeping\" functions such as learning and publishing <i>leasesets</i>, testing client tunnels, and learning about and validating other routers in the network. These tunnels are normally low-bandwidth.";
    t[10747] = "Een tunnel die door de router wordt gebruikt om te communiceren met andere routers om verschillende 'beheertaken' uit te voeren, zoals het leren en publiceren van <i>leasesets</i>, het testen van clienttunnels en het leren kennen en valideren van andere routers in het netwerk. Deze tunnels hebben meestal een lage bandbreedte.";
