    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "Standaard zal I2P het systeem geconfigureerde standaardbrowser gebruiken om mee te openen bij het opstarten. Als u een alternatieve browser wilt gebruiken, moet u uw router.config-bestand bewerken (of de <a href=/configadvanced>Geavanceerde configuratiepagina</a> als u geavanceerde consolemodus heeft ingeschakeld) en een nieuwe configuratieregel toevoegen <code>routerconsole.browser=/pad/naar/browser</code> of <code>routerconsole.browser=\\pad\\naar\\browser.exe</code> als u Windows gebruikt, waarbij u <code>\\pad\\naar\\browser</code> vervangt door de locatie van de browser die u wilt gebruiken. Opmerking: Als het pad naar uw gekozen browser spaties bevat, moet u het pad mogelijk tussen aanhalingstekens plaatsen, bijvoorbeeld <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
