    t[11106] = "This setting (in hours) allows you to manually configure how old a RouterInfo is in order for it to be checked by the Refresh Routers Job. By default, the age of a RouterInfo before a refresh is intitiated scales according to the size of the NetDb, increasing as the NetDb grows in size. A value of 0 will force the Router Refresh Job to check every router in the NetDb, regardless of age.";
    t[11107] = "Deze instelling (in uren) stelt u in staat om handmatig te configureren hoe oud een RouterInfo moet zijn om te worden gecontroleerd door de Refresh Routers Job. Standaard schaalt de leeftijd van een RouterInfo voordat een vernieuwing wordt gestart volgens de grootte van de NetDb, waarbij de leeftijd toeneemt naarmate de NetDb groter wordt. Een waarde van 0 dwingt de Router Refresh Job om elke router in de NetDb te controleren, ongeacht de leeftijd.";
