    t[11128] = "An I2P web application that manages service destinations for the network, mapping B64 hashes to human-readable names. Destinations may be added manually, or via subscriptions to hosts.txt files. Also referred to as SusiDNS. For more information, see the <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[11129] = "Een I2P webtoepassing die de servicebestemmingen voor het netwerk beheert, waarbij B64-hashes worden gekoppeld aan leesbare namen. Bestemmingen kunnen handmatig worden toegevoegd of via abonnementen op hosts.txt-bestanden. Ook bekend als SusiDNS. Voor meer informatie, zie de <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>online documentatie</a>.";
