    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Uw modem of router ondersteunt mogelijk <a href=https://nl.wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), wat automatische poortdoorsturing mogelijk maakt. Zorg ervoor dat UPnP-ondersteuning voor I2P+ is ingeschakeld op de <a href=/confignet>configuratiespagina</a>, probeer vervolgens UPnP te activeren op uw modem/router en mogelijk ook op uw computer. Herstart nu de <a href=/>I2P+ router</a>. Als dit gelukt is, zou I2P+ \"Status: OK\" moeten melden in het zijpaneel zodra de I2P+ router de initi\u00eble connectiviteitstests heeft voltooid.";
