    t[12026] = "I2P FAQ";
    t[12027] = "I2P FAQ";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "Als u over de kop <i>Router Info</i> zweeft, wordt uw afgekapte routeridentiteit getoond (de eerste vier tekens (24 bits) van uw 44-tekens (256 bits) Base64-routerhash). De volledige hash wordt getoond op uw <a href='netdb?r=.'>netwerkdatabasevermelding</a>. Onthul dit nooit aan iemand, aangezien uw routeridentiteit uniek is gekoppeld aan uw IP-adres in de netwerkdatabase.";
