    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "Directorylijsten (ook wel virtuele mappen genoemd) zijn standaard ingeschakeld, zodat u bestanden uit een submap van <code>docroot</code> kunt hosten zonder een pagina met links naar de bestanden aan te bieden. Je kunt ook inhoud weergeven die buiten <code>docroot</code> bestaat door een <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'> te gebruiken symbolische link</a> naar de gewenste directory.";
