    t[12062] = "Using the <i class=example>explicit</i> directive, a threshold can be applied to a remote destination listed in the definition itself, with the option to specify custom thresholds for multiple destinations. Remote destinations can also be excluded from the default threshold using the <i class=example>allow</i> keyword, or permanently blocked using the <i class=example>deny</i> keyword:";
    t[12063] = "Met behulp van de <i class=example>explicit</i> directive kan een drempelwaarde worden toegepast op een externe bestemming die vermeld staat in de definitie zelf, met de mogelijkheid om aangepaste drempelwaarden op te geven voor meerdere bestemmingen. Externe bestemmingen kunnen ook worden uitgesloten van de standaard drempelwaarde met behulp van het <i class=example>allow</i> trefwoord, of permanent worden geblokkeerd met het <i class=example>deny</i> trefwoord:";
