    t[12184] = "This setting determines the number of NetDb DHT buckets the Peer Exploration Job will reference when run. By default, the number of buckets to explore will vary depending on whether the router has been running for over an hour, if the router is hidden or in the 'K' bandwidth tier, and the number of known routers.";
    t[12185] = "Deze instelling bepaalt het aantal NetDb DHT-buckets waarnaar de Peer Exploration Job zal verwijzen tijdens het uitvoeren. Standaard zal het aantal te verkennen buckets vari\u00ebren, afhankelijk van hoe lang de router al draait, als de router verborgen is of zich in de 'K' bandbreedtetier bevindt en het aantal bekende routers.";
