    t[12200] = "If the number of known peers drops below 50, I2P will attempt to reseed automatically. If the reseed attempt fails, a notification will appear in the sidebar with an option to manually reseed. A failed reseed attempt can occur if your local firewall limits outbound traffic, you are experiencing network connectivity issues, or if the reseed request is blocked entirely.";
    t[12201] = "Als het aantal bekende peers onder de 50 daalt, zal I2P automatisch proberen om te zaaien. Als de zaai-poging mislukt, zal er een melding verschijnen in de zijbalk met de optie om handmatig te zaaien. Een mislukte zaai-poging kan optreden als uw lokale firewall uitgaand verkeer beperkt, als u problemen heeft met de netwerkverbinding, of als het zaai-verzoek volledig wordt geblokkeerd.";
