    t[12228] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces in the <code>jetty.xml</code> file.";
    t[12229] = "Kan worden uitgeschakeld in het bestand clients.config. Kan ook worden geconfigureerd om te binden aan een specifieke interface of alle interfaces in het bestand jetty.xml.";
    t[12230] = "You can determine which services automatically start when the router starts, manage tunnel allocation to optimize for high usage services or to minimize the the cpu and memory overhead, add server and client tunnels to host or access services on the network, set rate limiting or tunnel filtering for your server tunnels and more.";
    t[12231] = "U kunt bepalen welke services automatisch starten wanneer de router start, tunneltoewijzing beheren om te optimaliseren voor services met veel gebruik of om de CPU- en geheugenoverhead te minimaliseren, server- en clienttunnels toevoegen om services op het netwerk te hosten of toegang te krijgen tot services, snelheidsbeperking of tunnelfiltering instellen voor uw servertunnels en meer.";
    t[12232] = "Binds to the LAN address. Can be changed with advanced config <code>i2np.upnp.HTTPPort=nnnn</code>. Can be disabled on the <a href=/confignet>Network Configuration page</a>.";
    t[12233] = "Bindt zich aan het LAN-adres. Kan worden gewijzigd met geavanceerde configuratie <code>i2np.upnp.HTTPPort=nnnn</code>. Kan worden uitgeschakeld op de <a href=/confignet>Netwerkconfiguratiepagina</a>.";
