    t[12245] = "Voeg in het vakje met de tekst <i>Niet voor proxy</i> de regel <code>127.0.0.1,localhost</code> toe om ervoor te zorgen dat de I2P-console en andere lokaal gehoste websites nog steeds beschikbaar zijn.";
